body.query:
{
  pairs(
    first: 200,
    orderBy: volumeUSD,
    orderDirection: desc
  ) {
    id,
    base: token0 {
      id
      symbol
      name
    }
    quote: token1 {
      id
      symbol,
      name
    }
    close: token1Price,
    baseVolume: volumeToken0,
    quoteVolume: volumeToken1
  }
}

{
  blocks(
    first: 1,
    orderBy: timestamp,
    orderDirection: desc,
    where: {
      timestamp_gt: 1600085471,
      timestamp_lt: 1600086071
    }
  ) {
    number,
    timestamp
  }
}

